import './App.css';
import { Routes, Route } from 'react-router-dom';
import Header from './header';
import Banner from './banner';
import RestaurantsLists from './RestaurantsLists';
import RestaurantCard from './RestaurantCard'; // rename file to RestaurantCard.js
import Cart from './Cart';
import { AppProvider } from './context';

const App = () => {
  return (
    <AppProvider>
      <div className="app">
        <Header />
        <Routes>
          <Route
            path="/"
            element={
              <>
                <Banner />
                <RestaurantsLists />
                <RestaurantCard />
              </>
            }
          />
          <Route path="/cart" element={<Cart />} />
        </Routes>
      </div>
    </AppProvider>
  );
};

export default App;
